import React from 'react';
import {useRouter,} from 'next/router';
import Link from 'next/link';

function HomePage() {

    const router = useRouter();

    return (
    <>
      <div>
        <h1>Sell your products with the global, integrated payment network</h1>
        <p>A budding simple e-commerce management software solution for social media users/channels that can embed your store with a
          single short url link. Compatible with cryptocurrency ($XRP) or traditional credit cards.
        </p>
        <Link href="/register">
          <a>Get Started</a>
        </Link>
        <br/>
        <Link href="/login">
          <a>Login</a>
        </Link>
        </div>
    </>
    )
  };
  
export default HomePage;
